        res.redirect(routes.home);
    }else{
        next();
    }
}

export const onlyPrivate = (req, res, next) => {
    if(req.user){
        next();
    }else{
        res.redirect(routes.home)
    }
}
export const uploadVideo = multerVideo.single('videoFile');

